import { patientConstants } from '../_constants';

export function registration(state = {}, action) {
  switch (action.type) {
    case patientConstants.REGISTER_REQUEST:
      return { registering: true };
    case patientConstants.REGISTER_SUCCESS:
      return {};
    case patientConstants.REGISTER_FAILURE:
      return {};
    default:
      return state
  }
}
